import React from 'react';
import DashboardLayout from './DashboardLayout';
import AuthorizationGuard from './AuthorizationGuard';

const ProtectedPageLayout = ({ children, allowedRoles, redirectTo = "/login" }) => {
  return (
    <AuthorizationGuard allowedRoles={allowedRoles} redirectTo={redirectTo}>
      <DashboardLayout>
        {children}
      </DashboardLayout>
    </AuthorizationGuard>
  );
};

export default ProtectedPageLayout;
